import React from 'react';

export default function submit() {

  return (
    <>
    <Button
                  onClick={editingFile ? handleEditSubmit : handleSubmit}
                  color="primary"
                  variant="contained"
                >
                  {editingFile ? "Save Changes" : "Submit"}
                </Button>
    </>
    
  )
}
